import React from 'react'
import { Switch, Route } from 'react-router-dom';
import Layout from './hoc/layout'
import Home from './components/home/index'

const Routes = () => {
    return(
        <div>
            <Layout>
                <Switch>
                    <Route path='/' exact component={Home} />
                </Switch>
            </Layout>

        </div>
    )
}

export default Routes;
